Descrição
Motor Portão Deslizante Inteligente 100% Wifi AGL DZ IZZY Trino 300
Potência 1/4 HP Para portão até 300 quilos
º APP Grátis AGL Home Disponivel iOS Play Store
º Conexão Via Wifi
º Conexão Via Bluetooth
º Simples e Rápido a instalação.
---------------------------------------------------------------------------------------------------------------
DESCRIÇÃO
Novo motor de portão AGL IZZY!
Saia do passado e salte para o futuro e controle seu portão 100% pelo smartphone.
Abra ou feche o seu portão pelo controle, pelo aplicativo e por comando de voz!
Saiu de casa e não lembra se fechou o portão? É só verificar no aplicativo se está aberto ou fechado.
Precisa abrir o portão da sua casa para um amigo? Com um simples toque ou comando de voz e o portão está aberto!
Precisa gravar um novo controle? Muito simples, pelo aplicativo é fácil gravar e não precisa abrir o motor!
Quer saber toda vez que o portão abre? É só configurar receber notificações!
Configuração 100% pelo aplicativo.
Motor AGL IZZY é outro nível!
Características técnicas:
• Dual mode Wi-fi + Bluetooth (rede sem fio 2.4GHz, não aceita rede 5 GHz);
• Acionamento e controle à distância via aplicativo AGL HOME ou comando de voz;
• Histórico de abertura e fechamento de portão;
• Indicação de portão aberto ou fechado pelo aplicativo;
• Notificações push instantâneas via smartphone;
• 12 funções para ajuste e configuração da instalação;
• Compatível com assistentes de voz (Alexa, Siri, Google Assistant);
• Velocidade de abertura do portão devidamente balanceado
de 3 metros em aproximadamente 12 segundos;
• Embreagem de fácil regulagem controlada via aplicativo;
• Destravamento para manual: por chave;
• Protetor térmico contra queima por aquecimento;
• Freio eletrônico e sistema anti aprisionamento;
• Saída para fotocélula e botoeira;
• Saída para luz de garagem trava e sinaleira
(necessário o uso da Placa Acionadora).
ATENÇÃO! NÃO É BIVOLT, escolha a (VOLTAGEM TENSÃO) na hora da compra, após a compra não conseguimos alterar. 110V OU 220V.
Itens inclusos:
----------------------------------------------------------------------------------------------------
01 Motor AGL para Portão Deslizante Modelo DZ IZZY Trino 300 WIFI
02 Controles remoto
3,5 metros de cremalheira
01 Tx car
Potência 1/4 HP e Para portão até 300 quilos
